    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    NWR, Huron Island NWR, and Harbor Island NWR outlines Refuge accomplishments during
    the 1991 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, manpower
    programs, volunteer programs, funding, and safety is given. Habitat management is
    also covered; subjects include wetlands, forests, haying, fire management, pest
    control, and wilderness areas. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, wildlife propagation, scientific collections,
    marking and bird banding, and disease control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    wildlife observation, outdoor recreation, and law enforcement. The equipment and
    facilities section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment replacement, and computer systems. Cooperative programs
    and items of interest are provided at the end. Refuge brochures, newsletters, and
    field guides are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
